import { AnyAction, Reducer } from 'redux';
import { IAppRequestState, initialRequestState, GlobalReducer } from './state';
import { AllTypeActions } from '../types';

export const AdvertisementReducer: Reducer = (state: IAppRequestState = initialRequestState, action: AnyAction) => {
	return GlobalReducer(state, action, AllTypeActions.ADD_ADVERTISEMENT.toString());
};
